import { useEffect,useState  } from "react";
import "./index.css"
function EmpList(){
    const [data,setData]=useState(null)
    useEffect(()=>{
        fetch("http://localhost:3007/Employe")
        .then((res)=>{
            return res.json()
        })
        .then((resp)=>{
            console.log(resp)
            setData(resp.data)
        })
    })
    return(
        <div>
    
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>City</th>
                        <th>Mobile</th>
                                             
                    </tr>
                </thead>
                <tbody>
                    {data?.map((item)=>(

                    
                    <tr>
                        <td>{item.id}</td>
                        <td>{item.name}</td>
                        <td>{item.city}</td>
                        <td>{item.last_name}</td>
                        <td>{item.avatar}</td>
                       
                    </tr>
                     ))}
                </tbody>
            </table>
        </div>
    )
}
export default EmpList;
